import React from "react";


const Recipe= ({id, name,diets,image})=>{
    
  

    return (
        <div>
        {
            <div>
                <img src={image} alt="recipe" />
                <ul  key={id}>
              {  diets.map(d=> <li>{d.name}</li>)}
                    {typeof diets === "object" ? diets.map(d=> <li>{d.name}</li>) : diets}  
                </ul>
            </div>
        }
        </div>)
}   

export default Recipe;
